It is best to use a $project stage when the required shape of output documents is very different from the input documents' shape. This situation often arises when you do not need to include most of the original fields. This time for the same input payments collection, let us imagine you require a new aggregation pipeline to produce result documents. You need each output document's structure to be very different from the input structure, and you need to retain far fewer original fields, similar to the following: // OUTPUT (a record in the results of the executed aggregation)
{ transaction_info: { date: ISODate("2021-01-13T09:32:07.000Z"), amount: NumberDecimal("501.98") }, status: "REPORTED"
} Using $set/$unset in the pipeline to achieve this output structure would be verbose and would require naming all the fields (for exclusion this time), as shown below: // BAD
[ {"$set": { // Add some fields "transaction_info.date": "$transaction_date", "transaction_info.amount": "$transaction_amount", "status": {"$cond": {"if": "$reported", "then": "REPORTED", "else": "UNREPORTED"}}, }}, {"$unset": [ // Remove _id field "_id", // Must name all other existing fields to be omitted "card_name", "card_num", "card_expiry", "card_sec_code", "card_provider_name", "transaction_id", "transaction_date", "transaction_curncy_code", "transaction_amount", "reported", ]}, ] However, by using $project for this specific aggregation, as shown below, to achieve the same results, the pipeline will be less verbose. The pipeline will have the flexibility of not requiring modification if you ever make subsequent additions to the data model, with new previously unknown fields: // GOOD
[ {"$project": { // Add some fields "transaction_info.date": "$transaction_date", "transaction_info.amount": "$transaction_amount", "status": {"$cond": {"if": "$reported", "then": "REPORTED", "else": "UNREPORTED"}}, // Remove _id field "_id": 0, }},
] Another potential downside can occur when using $project to define field inclusion, rather than using $set (or $addFields). When using $project to declare all required fields for inclusion, it can be easy for you to carelessly specify more fields from the source data than intended. Later on, if the pipeline contains something like a $group stage, this will cover up your mistake. The final aggregation's output will not include the erroneous field in the output. You might ask, "Why is this a problem?". Well, what happens if you intended for the aggregation to take advantage of a covered index query for the few fields it requires, to avoid unnecessarily accessing the raw documents. In most cases, MongoDB's aggregation engine can track fields' dependencies throughout a pipeline and, left to its own devices, can understand which fields are not required. However, you would be overriding this capability by explicitly asking for the extra field. A common error is to forget to exclude the _id field in the projection inclusion stage, and so it will be included by default. This mistake will silently kill the potential optimisation. If you must use a $project stage, try to use it as late as possible in the pipeline because it is then clear to you precisely what you are asking for as the aggregation's final output. Also, unnecessary fields like _id may already have been identified by the aggregation engine as no longer required, due to the occurrence of an earlier $group stage, for example.

