Sometimes, you need an aggregation pipeline to mutate or reduce an array field's content for each record. For example: You may need to add together all the values in the array into a total field You may need to retain the first and last elements of the array only You may need to retain only one reoccurring field for each sub-document in the array ... or numerous other array 'reduction' scenarios To bring this to life, imagine a retail orders collection where each document contains an array of products purchased as part of the order, as shown in the example below: [ { _id: 1197372932325, products: [ { prod_id: 'abc12345', name: 'Asus Laptop', price: NumberDecimal('429.99') } ] }, { _id: 4433997244387, products: [ { prod_id: 'def45678', name: 'Karcher Hose Set', price: NumberDecimal('23.43') }, { prod_id: 'jkl77336', name: 'Picky Pencil Sharpener', price: NumberDecimal('0.67') }, { prod_id: 'xyz11228', name: 'Russell Hobbs Chrome Kettle', price: NumberDecimal('15.76') } ] }
] The retailer wants to see a report of all the orders but only containing the expensive products purchased by customers (e.g. having just products priced greater than 15 dollars). Consequently, an aggregation is required to filter out the inexpensive product items of each order's array. The desired aggregation output might be: [ { _id: 1197372932325, products: [ { prod_id: 'abc12345', name: 'Asus Laptop', price: NumberDecimal('429.99') } ] }, { _id: 4433997244387, products: [ { prod_id: 'def45678', name: 'Karcher Hose Set', price: NumberDecimal('23.43') }, { prod_id: 'xyz11228', name: 'Russell Hobbs Chrome Kettle', price: NumberDecimal('15.76') } ] }
] Notice order 4433997244387 now only shows two products and is missing the inexpensive product. One naïve way of achieving this transformation is to unwind the products array of each order document to produce an intermediate set of individual product records. These records can then be matched to retain products priced greater than 15 dollars. Finally, the products can be grouped back together again by each order's _id field. The required pipeline to achieve this is below: // SUBOPTIMAL var pipeline = [ // Unpack each product from the each order's product as a new separate record {"$unwind": { "path": "$products", }}, // Match only products valued over 15.00 {"$match": { "products.price": { "$gt": NumberDecimal("15.00"), }, }}, // Group by product type {"$group": { "_id": "$_id", "products": {"$push": "$products"}, }},
]; This pipeline is suboptimal because a $group stage has been introduced, which is a blocking stage, as outlined earlier in this chapter. Both memory consumption and execution time will increase significantly, which could be fatal for a large input data set. There is a far better alternative by using one of the Array Operators instead. Array Operators are sometimes less intuitive to code, but they avoid introducing a blocking stage into the pipeline. Consequently, they are significantly more efficient, especially for large data sets. Shown below is a far more economical pipeline, using the $filter array operator, rather than the $unwind/$match/$group combination, to produce the same outcome: // OPTIMAL var pipeline = [ // Filter out products valued 15.00 or less {"$set": { "products": { "$filter": { "input": "$products", "as": "product", "cond": {"$gt": ["$$product.price", NumberDecimal("15.00")]}, } }, }},
]; Unlike the suboptimal pipeline, the optimal pipeline will include 'empty orders' in the results for those orders that contained only inexpensive items. If this is a problem, you can include a simple $match stage at the start of the optimal pipeline with the same content as the $match stage shown in the suboptimal example. To reiterate, there should never be the need to use an $unwind/$group combination in an aggregation pipeline to transform an array field's elements for each document in isolation. One way to recognize if you have this anti-pattern is if your pipeline contains a $group on a $_id field. Instead, use Array Operators to avoid introducing a blocking stage. Otherwise, you will suffer a magnitude of increase in execution time when your pipeline handles more than 100MB of in-flight data. Adopting this best practice may mean the difference between achieving the required business outcome and abandoning the whole task as unachievable. The primary use of an $unwind/$group combination is to correlate patterns across many records' arrays rather than transforming the content within each input record's array only. For an illustration of an appropriate use of $unwind/$group refer to this book's Unpack Array & Group Differently example.

